textOriginal:
kenapa KDM yg hanya gubernur jabar diserang oleh pejabat/politikus yg kebanyakan bukan warga jabar? simpel saja ;
-ada pihak2 yg mendapat untung dengan melakukan/terlibat praktik2 illegal (misal ; pengusaha galian) or abu2 (misal ; pedagang yg ngelapak ditempat yg gk seharusnya) dan sepak terjang KDM dinilai mengganggu apa yg mereka lakukan
-strategi politik. saat ini KDM adalah gubernur jabar yg berasal dari golkar. kinerja KDM disukai masyarakat dan saat ini memiliki pengaruh yg sangat kuat. serangan2 politik bermunculan untuk meredam pengaruh dan popularitasnya karena saking kuatnya pengaruh KDM dimasyarakat saat ini, bisa dipastikan KDM dimasa depan akan menjadi calon kuat yg kans menangnya tinggi jika suatu saat maju untuk pilpres
